// @ts-ignore
import { loadXHR } from '../loadXHR';

onmessage = e => {
  console.log('Worker received:', e.data);
  if (process.browser) {
    loadXHR(e.data).then(function(blob) {
      console.log(blob);
    });
    console.log('I am on browser')
    // @ts-ignore
    // self.postMessage('from Worker');
  } else {
    console.log('I am on server');
  }
};
